import { Text, View } from 'react-native';
import { User } from '../../dtos/dtos';

export default function HomePage(props: {
  employee: User;
  updateEmployee: Function;
}) {
  return (
    <>
      <View>
        <Text>Welcome!</Text>
      </View>
    </>
  );
}
